import React from 'react';
import { useLocation } from 'react-router-dom'; // Import useLocation

interface FlightDetailsProps {
    // No need for props here
}

const FlightDetails: React.FC<FlightDetailsProps> = () => {
    // Use the useLocation hook to access the route state
    const location = useLocation<{ lastName: string; flightNumber: string }>();
    const { lastName, flightNumber } = location.state || {};

    return (
        <div className="landing-page">
            {/* Render the FlightDetails content */}
            <h1>Hello, {lastName}</h1>
            <p>Your flight number: {flightNumber}</p>
        </div>
    );
};

export default FlightDetails;
